  const [cvc, setCvc] = useState("");


  return (
    <>
    <div className='svg-colors'>
      <div className='credit-card'>
        <div className='contents'>
          <div className='image'></div>
        </div>
        <div className='contents-2'>
          <p id='a1'>{number}</p>
          <div className='name-expiry'>
            <p>{cardName}</p>
            <p>{year}</p>

          </div>
        </div>
      </div>
